import React, {userState} from 'react'
// components
import Navbar from '../../layout/Navbar';
// css
import '../../../css/business_login.css';
import '../../../css/stuck.css';
// images
import StuckCoder_Lying_Original_White_BG from '../../../img/official/StuckCoder_Lying_Original_White_BG.svg';

const Company_login = () => {



    // const [formData, setFormData] = userState({
    //     name: '',
    //     email: '',
    //     password: '',
    //     password2: ''
    // });

    // const {name,email,password,password2} = formData;

    // const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value});


    return (
        <div className="container-login">

            <Navbar />

            <main className="main-login-business">

                <div className="left">

                    <div className="st-card-login">
                        <div className="st-image-2">
                            <img src={StuckCoder_Lying_Original_White_BG} className="st-image-3" alt=""></img>
                        </div>
                        <div className="st-card-el-h2">Business Login</div>

                        <form action="" className="st-form">
                            <input 
                            className="st-input-field" 
                            type='text' 
                            placeholder='Email' 
                            name='email' 
                            value="" 
                            onChange="" 
                            required
                            ></input>

                                <input type="text" value="Email" className="st-input-field"></input>

                                <input type="text" value="Password" className="st-input-field"></input>

                                <button type="submit" className="st-button-secondary" value="Login">Enter</button>
                        </form>

                        <div className="st-card-el-h2">Or</div>
                        <div className="st-card-el-p">Register a new business</div>

                        <div className="st-card-el-h2">Business Registration</div>
                        <form action="" className="st-form">

                                <input type="text" value="Name" className="st-input-field"></input>
                                <input type="text" value="Email" className="st-input-field"></input>
                                <input type="text" value="Password" className="st-input-field"></input>
                                <input type="text" value="Confirm Password" className="st-input-field"></input>

                                <button type="submit" className="st-button-secondary" value="Register">Create</button>
                        </form>


                    </div>

                </div>


                <div className="right"></div>


            </main>

            <div className="footer">
                <div className="st-card-el-p">Copyright &copy; Stuckcoder AS 2019 - All Rights Reserved</div>
            </div>
    </div>
    )
}

export default Company_login
